import React , {Component, useState} from "react";

class Header extends Component { 

    
    render(){
      const  styling = {
          padding:"30px",
          padding:"3px ",
      }
      return (
          <header>
            <img style={styling} src="https://www.youtube.com/watch?v=_Q6YbIZsuPA" alt=""/>


          </header>
      );
    }
}

export default Header;
